import React, { Component } from 'react';
import { HotTable } from '@handsontable/react'
import 'handsontable/dist/handsontable.full.css';

class Table extends Component {
    constructor(props) {
        super(props)
        this.data = [
            ["", "Ford", "Volvo", "Toyota", "Honda"],
            ["2016", 10, 11, 12, 13],
            ["2017", 20, 11, 14, 13],
            ["2018", 30, 15, 12, 13]
        ];
    }

    

    render() {
        const settings = {
            data: this.data,
            rowHeaders: true,
            colHeaders: true,
            licenseKey: 'non-commercial-and-evaluation'
          }
        return (
            <div id="hot-app">
                <HotTable settings={settings} data={this.data} colHeaders={true} rowHeaders={true} width="600" height="300" />
            </div>
        );
    }
}

export default Table;
